/* jshint -W024 */
/* jshint expr:true */
//to avoid jshint errors for expect

var bootstrap = require('./bootstrap');
var chalk = require('chalk');
var async = require('async');
var log = require('oe-logger')('model-rule-belongsTo-relation-test');
var chai = require('chai');
var expect = chai.expect;
var loopback = require('loopback');
chai.use(require('chai-things'));
var models = bootstrap.models;
var prefix = 'data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,';
var fs = require('fs');

var Customer, Order;

describe(chalk.blue('model-rule-belongsTo-relation-test'), function() {
  before('creating the parent model', function(done) {
    var data = {
      name: 'XCustomer',
      properties: {
        name: {
          type: 'string',
          id: true
        },
        amount: {
          type: 'object'
        }
      }
    };

    models.ModelDefinition.create(data, bootstrap.defaultContext, function (err, models) {
      var testModel = loopback.getModel(data.name, bootstrap.defaultContext);
      // testModelWithBase = loopback.getModel(testModelAsBasePM, bootstrap.defaultContext);
      expect(testModel.modelName).to.equal('XCustomer-test-tenant');
      Customer = testModel;

      done(err);
    });
  });

  before('creating the child model', function(done) {
    var data = {
      name: 'XOrder',
      properties: {
        gate: {
          type: 'string'
        }
      },
      relations: {
        cust: {
          type: 'belongsTo',
          model: 'XCustomer'
        }
      }
    };

    models.ModelDefinition.create(data, bootstrap.defaultContext, function (err, models) {
      var testModel = loopback.getModel(data.name, bootstrap.defaultContext);
      // testModelWithBase = loopback.getModel(testModelAsBasePM, bootstrap.defaultContext);
      expect(testModel.modelName).to.equal('XOrder-test-tenant');
      Order = testModel;
      done(err);
    });
  });

  var custId;
  // var orderId;
  before('creating some dummy data in XCustomer', function(done) {
    var data = {
      name: 'Ankur',
      amount: {
        value: 100,
        unit: 'INR'
      }
    };

    Customer.create(data, bootstrap.defaultContext, function(err, result) {
      // expect(err).to.be.null;
      // expect(result.name).to.equal(data.name);
      // custId = result.id;
      // done();
      if (err) {
        done(err)
      }
      else {
        expect(err).to.be.null;
        expect(result.name).to.equal(data.name);
        custId = result.id;
        done();
      }
    });
  });

  before('creating some dummy data in Order', function(done) {
    var data = {
      gate: 'foo',
      custId: 'Ankur'
    };

    Order.create(data, bootstrap.defaultContext, function(err, result) {

      if (err) {
        done(err)
      }
      else {
        // console.dir(err);
        expect(err).to.be.null;
        expect(result.date).to.equal(data.date);
        // console.dir(result);
        // orderId = result.id;
        done();
      }
    });
  });

  before('creating a decision table', function(done) {
    var DecisionTable = models.DecisionTable;
    var data = {
      name: 'TestDecision',
      document: {
        documentName: 'fetch_relations.xlsx',
        // documentData: 'data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,'
        // documentData : 'data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,'
        // documentData: 'data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,'
        documentData : prefix + fs.readFileSync(__dirname + '/model-rule-data/fetch_relations.xlsx').toString('base64')
      }
    };

    DecisionTable.create(data, bootstrap.defaultContext, function(err, result) {
      if (err) {
        done(err);
      }
      else {
        expect(result).to.not.be.null;
        expect(result.name).to.equal(data.name);
        done();
      }
    })
  });

  it('should fetch the relation in the decision table correctly', function(done){
    // debugger;
    var DecisionTable = models.DecisionTable;
    Order.findOne({ gate: 'foo' }, bootstrap.defaultContext, function(err, orderRecord) {
      if (err) {
        done(err)
      }
      else {
        // console.log('foo');
        expect(orderRecord).to.not.be.null;
        expect(orderRecord.gate).to.equal('foo');
        expect(orderRecord.cust).to.not.be.null;
        orderRecord.cust(bootstrap.defaultContext, function(err, relatedRecord) {
          // console.dir(relatedRecord);
          expect(relatedRecord).to.not.be.null;
          expect(relatedRecord.name).to.equal('Ankur');
          // done();
          // console.dir(bootstrap.defaultContext);
          // orderRecord.options = bootstrap.defaultContext;
          // orderRecord.options.modelName = Order.modelName;
          var payload = orderRecord.__data;
          payload.options = bootstrap.defaultContext;
          payload.options.modelName = Order.modelName;

          DecisionTable.exec('TestDecision', payload, bootstrap.defaultContext, function(err, dtResult) {
            if (err) {
              done(err)
            }
            else {
              // console.dir(dtResult);
              expect(dtResult["customer name"]).to.equal(100);
              done();
            }
          });
        });
        // done();
      }
    });
  });

  // after(function(){
  //   //model-feel-belongs-to-relation.js
  //   // debugger;
  // });
});
